import React from 'react';

import Select from 'react-select';

const colourOptions =[
  {1: 'Shit'},
  {2: 'Sshit'},
]
export default () => (
  <Select
    isMulti
    name="colors"
    options={colourOptions}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
